Tänään vieraana on ensihoitaja- kollega Ruotsista. Kari Hautamäki toimii ensihoitajana lähinnä pahamaisissa lähiöissä Ruotsissa. Alueilla, joilla on paljon jengi väkivaltaa ja ”ghettoutumiseen” liittyviä lieveilmiöitä. Ruotsi onkin viimeaikoina ollut tapetilla eskaloituvan jengiväkivallan takia, joten on syytä olla kuulolla! Kuuntele Karin tarina ja parhaimmat keikka kertomukset Tukholman lähiöistä.

